import React from 'react';
import Home from './Home';
import {Link, Route, BrowserRouter as Router, Switch} from 'react-router-dom'





const Data =  (props)=>{
   const data = props.data
   
    
    return(
        
       <>
        {data && data.map(data => <h1>{data.name}</h1> ) } 
       </>
  
        
    )
}


export default Data



